import React, { Component } from "react";
import { Row, Col } from "antd";

export default class Intro extends Component {
  render() {
    return (
      <Row
        type="flex"
        justify="center"
        align="middle"
        style={{ minHeight: "100vh" }}
      >
        <h1>DL 1961</h1>
        <Row>
          <Col xs={24} sm={24} md={10} lg={10} span="12">
            <h3>DIGITAG_Program</h3>
          </Col>
        </Row>
      </Row>
    );
  }
}
